import React from 'react';
import moment from 'moment-timezone';
import './Horloge.css';


class Horloge extends React.Component {

	render(){
		return(
			<div>
				<h2>It is { thisprops.toLocaleTimeString() }</h2>
			</div>
		)
	}
}


const horloge = () => {

	return(
			<Horloge />
		)
}
setInterval(Horloge, 1000);

export default Horloge;
